INSERT INTO `noticia` VALUES ('2', '1', 'El stock argentino creció en 800 mil cabezas a 2017', '<p>Una vez m&aacute;s tuvimos el agrado de contar con nuestro equipo de ventas de Argentina, Brasil y Uruguay en las instalaciones de CIALE Alta. Acompa&ntilde;ados por un excelente d&iacute;a, la jornada se desarroll&oacute; en el transcurso de la ma&ntilde;ana con una breve charla abarcando temas de mercado y t&eacute;cnicos.&nbsp;</p>', '<div class=\"tinymce\">\r\n<p>El stock vacuno argentino alcanz&oacute; a 53,4 millones de cabezas, mostrando un incremento de 800 mil animales (1,4%) en relaci&oacute;n a un a&ntilde;o atr&aacute;s. Los datos surgen del relevamiento al 31 de marzo que el Senasa realiza de forma ininterrumpida desde 2008.</p>\r\n\r\n<p>La cifra es superior en 2 millones a la de 2015 y en 5,4 millones a la de 2011, a&ntilde;o con las existencias m&aacute;s bajas en esta serie de 10 a&ntilde;os.</p>\r\n\r\n<p>Adem&aacute;s, este es el sexto a&ntilde;o seguido con crecimiento (a excepci&oacute;n de la ca&iacute;da de 200 mil cabezas en 2015), y desde el piso de 2011 la mejora ronda las 900 mil cabezas por a&ntilde;o, alrededor del 2% del stock.</p>\r\n\r\n<p><strong>Por provincia</strong></p>\r\n\r\n<p>De acuerdo a la estimaci&oacute;n del Senasa, hay 11 provincias con m&aacute;s de 1 mill&oacute;n de cabezas, las que acumulan el 95% del stock total.</p>\r\n\r\n<p>Entre &eacute;stas, Buenos Aires que tiene el 34% del total nacional, creci&oacute; 4% desde marzo de 2016. Tambi&eacute;n aumentaron los rodeos de C&oacute;rdoba, 2%; La Pampa, 4%; Formosa, 1%; San Luis, 3%; Santiago del Estero, 6%; y Salta, 5%.</p>\r\n\r\n<p>Con bajas en su stock aparecen Santa Fe, 2%; Corrientes, 5%; y Entre R&iacute;os, 3%; mientras que Chaco no mostr&oacute; variaciones.</p>\r\n\r\n<p>La fuerte ca&iacute;da de Corrientes y el aumento de C&oacute;rdoba provocaron que &eacute;sta pasara a ser la tercera provincia en importancia, intercambiando su lugar con el distrito mesopot&aacute;mico.</p>\r\n\r\n<p><strong>Por categor&iacute;a</strong></p>\r\n\r\n<p>El stock de&nbsp;<strong>vacas</strong>&nbsp;creci&oacute; el 2% a nivel nacional. Entre las 11 provincias con mayor rodeo, las mismas que redujeron sus existencias totales son las que muestran menos ejemplares de la categor&iacute;a. Las de mayor aumento son La Pampa, Santiago y Salta, con el 5%.</p>\r\n\r\n<p>El n&uacute;mero de&nbsp;<strong>terneros y terneras</strong>, segunda categor&iacute;a en importancia, se mantuvo estable a nivel nacional. La mayor&iacute;a de las provincias importantes lo redujo, encabezadas por Corrientes que mostr&oacute; una merma de 7%. Salta y Santiago fueron las que m&aacute;s aumentaron, con 10% y 6%, respectivamente. Buenos Aires aument&oacute; 2%.</p>\r\n\r\n<p>En&nbsp;<strong>vaquillonas</strong>, tercera categor&iacute;a en n&uacute;mero, hubo un crecimiento de 3% a nivel nacional. De las principales provincias, las que m&aacute;s aumentaron fueron La Pampa, San Luis y Buenos Aires, con 11, 10 y 9%, respectivamente. Chaco, con -4%, tuvo la principal ca&iacute;da.</p>\r\n\r\n<p>Los&nbsp;<strong>novillitos</strong>&nbsp;incrementaron su n&uacute;mero en el pa&iacute;s en 2%. Los aumentos los encabezaron San Luis y Chaco, con 16 y 14%, en ese orden; seguidas por Buenos Aires y Santiago del Estero, con 11%. En Corrientes se dio la principal ca&iacute;da: 12%.</p>\r\n\r\n<p>Finalmente, la categor&iacute;a&nbsp;<strong>novillos</strong>&nbsp;redujo su n&uacute;mero en el a&ntilde;o. Y fue la &uacute;nica que tuvo un movimiento negativo a nivel nacional.</p>\r\n\r\n<p>Santiago y C&oacute;rdoba fueron las que mostraron los mayores aumentos, con 10 y 6%. En la Mesopotamia, Entre R&iacute;os y Corrientes vieron reducir su n&uacute;mero, con 9 y 8%, respectivamente.</p>\r\n\r\n<p>El porcentaje de pariciones, comparando la cantidad de terneros con la de vacas del a&ntilde;o anterior, muestra un muy magro 61,5%, un dato que requiere un an&aacute;lisis pormenorizado.</p>\r\n\r\n<p><strong>Conclusiones</strong></p>\r\n\r\n<p>En los &uacute;ltimos 12 meses se anot&oacute; un crecimiento del stock moderado pero que genera entusiasmo y sucedi&oacute; virtualmente por sexto a&ntilde;o consecutivo.</p>\r\n\r\n<p>En esta carrera, se destacaron Santiago del Estero con el 6%, Salta con el 5% y Buenos Aires y La Pampa con el 4%.</p>\r\n\r\n<p>El aumento del n&uacute;mero de vaquillonas, a una tasa que fue el doble de la de vacas permite abrigar la expectativa de una mayor retenci&oacute;n.</p>\r\n\r\n<p>Todav&iacute;a falta ver crecer a la categor&iacute;a novillo para ser m&aacute;s optimistas.</p>\r\n\r\n<p>FUENTE:&nbsp;http://www.valorcarne.com.ar/&nbsp;</p>\r\n</div>', '2017-04-20', '1', 'C052A915-892F-4BD9-BCDA-0DEE0E605E84');
INSERT INTO `noticia` VALUES ('3', '1', '3° Curso de Inseminación Artificial', '<p>3&deg; Curso de Inseminaci&oacute;n Artificial en la Sociedad Rural de San Justo (Santa F&eacute;). Organizan: La Sociedad Rural de San Justo y Alta CIALE. Contactos e informes: Tel.: (03498) 427403 o por mail prensa.srsj@gmail.com</p>', '<p>Costo del curso: $3900 - Cupos Limitados. El curso se dictar&aacute; en &quot;Caba&ntilde;a Los Charabones&quot;</p>', '2017-02-21', '1', '1B3F7EA9-07FA-44DC-B663-970DA04CAFF4');
INSERT INTO `noticia` VALUES ('4', '1', 'Una nueva oportunidad', '<p>El comercio mundial de carnes retomar&iacute;a en 2017 los vol&uacute;menes previos a la crisis de 2014, con precios firmes, si no se ve afectado por nuevos proteccionismos. Otra buena noticia es que el Mercosur podr&aacute; ampliar su participaci&oacute;n en China, ocupando los espacios que dej&oacute; la fuerte ca&iacute;da de la oferta australiana. Por Miguel Gorelik.</p>', '<div class=\"tinymce\">\r\n<p>En el segundo semestre de 2016 hubo un repunte de las exportaciones de carnes de los seis pa&iacute;ses l&iacute;deres, que representan el 75% del mercado internacional, saliendo as&iacute; del baj&oacute;n registrado durante el a&ntilde;o y medio previo.</p>\r\n\r\n<p>Lo m&aacute;s destacado es que esta mejora se pudo lograr a pesar de la fuerte retracci&oacute;n de las exportaciones australianas y la debilidad de la oferta de Brasil. As&iacute; las cosas, la recuperaci&oacute;n qued&oacute; en manos de EE.UU., la India y Uruguay.</p>\r\n\r\n<p>Ampliando la mirada, si se toma todo el &uacute;ltimo a&ntilde;o y se lo compara con el previo, se ve que mientras Australia redujo sus ventas 20%, Brasil y la India las mantuvieron y Paraguay, EE.UU. y Uruguay las incrementaron entre 2 y 11%.</p>\r\n\r\n<p>De esta forma, 2016 cerr&oacute;&nbsp; con una baja de s&oacute;lo 4% en relaci&oacute;n a 2015, aunque con tendencia creciente. M&aacute;s a&uacute;n, los vol&uacute;menes embarcados en el &uacute;ltimo semestre fueron alcanzando el promedio de los &uacute;ltimos dos a&ntilde;os. En tanto, los precios tambi&eacute;n se recobraron- a pesar de la baja de los de EE.UU.- pero a&uacute;n muestran un cierto rezago con respecto al promedio del trienio.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cabe aclarar que los pa&iacute;ses que se miden para hacer este an&aacute;lisis son la India, Brasil, Australia, Estados Unidos, Paraguay y Uruguay. Para completar el cuadro con los ocho l&iacute;deres est&aacute;n faltando los datos de Canad&aacute; y Nueva Zelandia, que exportan algo m&aacute;s que Paraguay y Uruguay, pero cuyas estad&iacute;sticas no est&aacute;n disponibles con tanta inmediatez.</p>\r\n\r\n<p><strong>A 2017</strong></p>\r\n\r\n<p>De este an&aacute;lisis global, se desprenden dos conclusiones importantes.</p>\r\n\r\n<p>El mercado mundial de carnes tiene posibilidades de retomar niveles de comercio y precios que no se ve&iacute;an desde antes de la crisis financiera y de materias primas de 2014, siempre y cuando fen&oacute;menos como el reciente proteccionismo de Estados Unidos y el Brexit no generen disrupciones importantes en los flujos internacionales.</p>\r\n\r\n<p>Un factor que jugar&aacute; a favor para muchos pa&iacute;ses exportadores es el &ldquo;agujero&rdquo; que deja Australia, con la fuerte retracci&oacute;n de su oferta, algo que puede ser aprovechado por sus competidores.</p>\r\n\r\n<p>En efecto, a ra&iacute;z de una sequ&iacute;a muy prologada, el pa&iacute;s oce&aacute;nico comenz&oacute; un raid de exportaciones crecientes a finales de 2012, que pasaron de 950 mil toneladas peso embarque por a&ntilde;o a 1,35 millones a mediados de 2015; pero, luego volvieron apenas por encima de su nivel inicial. Es decir, que &ldquo;desaparecieron&rdquo; de la oferta mundial unas 500/600 mil toneladas equivalente carcasa (tec) anuales, lo que contribuy&oacute; a mostrar&nbsp; cifras de comercio m&aacute;s bajas, pero esto no fue acompa&ntilde;ado por una menor voluntad de los importadores en comprar carne.</p>\r\n\r\n<p><strong>Mirando a China</strong></p>\r\n\r\n<p>En cuanto al provecho que pueden obtener los principales exportadores de la contracci&oacute;n de la oferta australiana, hay que tener en cuenta que sus ventas est&aacute;n muy concentradas en cuatro mercados: Estados Unidos, Jap&oacute;n, Corea del Sur y China, que en conjunto representan el 80% del total.</p>\r\n\r\n<p>El &uacute;nico mercado en el que la mayor&iacute;a de los pa&iacute;ses del Mercosur compite abiertamente con Australia es en el chino. En Corea s&oacute;lo lo hace Uruguay y en EE.UU. son &eacute;ste y Brasil desde hace pocos meses. La Argentina podr&iacute;a sumarse en cierto plazo.</p>\r\n\r\n<p>Tambi&eacute;n hay que considerar que la reducci&oacute;n australiana no ha sido pareja en todos sus mercados. Mientras que hacia EE.UU. y China la ca&iacute;da ha sido del orden del 40%, en Jap&oacute;n s&oacute;lo redujo 7% y en Corea aument&oacute; 8%.</p>\r\n\r\n<p>En definitiva, para el Mercosur el gran objetivo a analizar es China, al que lamentablemente a&uacute;n no ingresa Paraguay, pero tampoco accede la carne de Estados Unidos ni de la India, a pesar de recientes promesas chinas hacia ambos pa&iacute;ses.</p>\r\n\r\n<p>De todas formas, China ya es &ldquo;el gran mercado&rdquo; para Brasil, Uruguay y la Argentina, representando el 32% (incluyendo los fuertes embarques a Hong Kong), el 43% y el 36%, respectivamente. Como dato contundente, Australia le vendi&oacute; a China 75 mil tec menos en 2016 que un a&ntilde;o atr&aacute;s y cubrir ese faltante puede ser un objetivo interesante.</p>\r\n\r\n<p><strong>Los l&iacute;deres</strong></p>\r\n\r\n<p>Las exportaciones de Brasil se estancaron en 2016, aunque sus env&iacute;os a China treparon 70%. Las australianas cayeron 20%, pero en precios se desempe&ntilde;&oacute; mejor que sus competidores. EE.UU. aument&oacute; vol&uacute;menes pero baj&oacute; su valor por tonelada. Uruguay, el pa&iacute;s que m&aacute;s creci&oacute; en el a&ntilde;o. Aqu&iacute;, todos los datos pa&iacute;s por pa&iacute;s.</p>\r\n\r\n<p><em>India:</em>&nbsp;El actual l&iacute;der del mercado mundial sufri&oacute; una ca&iacute;da de 200 mil toneladas peso embarque (300 mil tec) anuales, entre principios de 2015 y abril &uacute;ltimo, de las que pudo recuperar 100 mil tec hasta fin de a&ntilde;o.</p>\r\n\r\n<p>En los &uacute;ltimos 12 meses, mientras que su volumen total se mantuvo, logr&oacute; aumentos del 15-20% hacia Vietnam, su principal mercado, e Irak, el 5&deg;, mientras que hubo retrocesos del 2-6% con Malasia, Egipto y Arabia Saudita, sus otros mercados importantes y un contundente -30% hacia el conjunto de las dem&aacute;s plazas.</p>\r\n\r\n<p>En cuanto a precios, la India los mantuvo con peque&ntilde;as variaciones, dentro de un rango de USD3100-3300 por tonelada embarcada, el menor valor entre los grandes exportadores.</p>\r\n\r\n<p><em>Brasil</em>: El segundo exportador mundial mostr&oacute; un comportamiento m&aacute;s inestable. Tomando de a 12 meses m&oacute;viles, los embarques se redujeron en la primera parte de 2015, se estabilizaron en el segundo semestre y crecieron en los primeros meses de 2016 para luego volver al nivel anterior.</p>\r\n\r\n<p>El a&ntilde;o pasado, las ventas a Hong Kong, que qued&oacute; como principal cliente, aumentaron 10% mientras que hacia China aumentaron nada menos que 70%, convirti&eacute;ndose en su segundo comprador. Egipto y Rusia, que les siguen en el ranking, retrocedieron 10-20%, con Ir&aacute;n sin mayores cambios.</p>\r\n\r\n<p>El precio brasile&ntilde;o mostr&oacute; una ca&iacute;da muy fuerte en 2015, del 20%, de lo que ha podido recuperar la mitad en los &uacute;ltimos tres trimestres.</p>\r\n\r\n<p><em>Australia</em>: Como se dijo m&aacute;s arriba, sus exportaciones cayeron 20% en 2016 y siguen en estos meses con una reducci&oacute;n interanual del mismo orden y los clientes que m&aacute;s perdieron fueron EE.UU. y China.</p>\r\n\r\n<p>En cambio, en materia de precios en d&oacute;lares de Estados Unidos, su performance fue mejor que la de los dem&aacute;s exportadores. Su valor medio FOB baj&oacute; de USD5700 a 5000 a lo largo de 2015 y hasta el final de 2016 pudo recuperar totalmente aquella baja.</p>\r\n\r\n<p><em>Estados Unidos</em>: Mientras que en 2015 promedi&oacute; 1,2 millones de tec al a&ntilde;o, con tendencia declinante, tuvo una marcada recuperaci&oacute;n desde marzo&rsquo;16 hasta diciembre, cuando pas&oacute; del equivalente a 1 mill&oacute;n de tec anuales a 1,5 mill&oacute;n.</p>\r\n\r\n<p>Una lectura preliminar, m&aacute;s all&aacute; de las condiciones internas que posibilitaron ese salto, es que es el mercado que m&aacute;s est&aacute; creciendo de entre los principales exportadores, al comparar las cifras de fines de a&ntilde;o con las de los primeros meses. En 2016 mostr&oacute; un crecimiento del 8% en volumen, que se conforma con aumentos fuertes hacia Jap&oacute;n (17%) y Corea (35%) y mucho menos a M&eacute;xico y ca&iacute;das del 10% a Canad&aacute; y Hong Kong.</p>\r\n\r\n<p>Lo llamativo es que fuera de su aumento en Jap&oacute;n, donde Australia retrocedi&oacute; un poco, sus mayores ventas a Corea tienen el mismo signo que las australianas y lo mismo sucede con su ca&iacute;da en el &aacute;rea Hong Kong/China.</p>\r\n\r\n<p>En cuanto a sus precios, ha tenido una ca&iacute;da muy marcada que no ha comenzado a recuperar. A lo largo de 2015 pas&oacute; de los USD8000 por tonelada embarcada de principios de a&ntilde;o a USD6400 de fines de a&ntilde;o, 20% de ca&iacute;da, y a lo largo de 2016 se mantuvo establemente en el mismo nivel.</p>\r\n\r\n<p><em>Uruguay</em>: Luego de una suave tendencia bajista en los vol&uacute;menes embarcados durante 2015, y tras haber alcanzado un m&iacute;nimo en mayo &uacute;ltimo, las ventas al exterior se aceleraron mes tras mes, marcando en diciembre 60% m&aacute;s que en mayo. El total del a&ntilde;o registr&oacute; 11% de aumento y es el que m&aacute;s creci&oacute; entre estos seis l&iacute;deres. Este aumento le permiti&oacute; quedar por encima de Paraguay en la carrera cabeza a cabeza que vienen desplegando en los &uacute;ltimos a&ntilde;os.</p>\r\n\r\n<p>Mostr&oacute; aumentos en las ventas hacia China y UE, del 15% en ambos casos, y del 7% a Israel, con ca&iacute;da menor hacia EE.UU. Pero el mercado que se destac&oacute; fue el canadiense donde duplic&oacute; sus ventas, desde una base peque&ntilde;a.</p>\r\n\r\n<p>En cuanto a los precios, se advierten dos per&iacute;odos contrastantes, desde principios de 2015 hasta mediados de 2016, cuando el valor medio perdi&oacute; cerca de un tercio, de USD6000 a USD4000 la tonelada embarcada. Contrariamente, en el segundo semestre fue recuperando los precios perdidos, hasta alcanzar en noviembre los de principios de 2015.</p>\r\n\r\n<p><em>Paraguay:&nbsp;</em>Las ventas externas de carnes mostraron una gran variabilidad mes a mes, en los &uacute;ltimos dos a&ntilde;os, en la que no es f&aacute;cil encontrar una tendencia que no sea de mantenimiento de los niveles.</p>\r\n\r\n<p>En 2016 s&oacute;lo tuvo un retroceso en las ventas a Rusia, 20%, mientras que con los otros principales clientes registr&oacute; aumentos del 15-20% con Chile, Brasil e Israel y donde se destac&oacute; Vietnam con m&aacute;s del doble, desde una base menor.</p>\r\n\r\n<p>Los precios recorrieron un patr&oacute;n similar a los uruguayos: ca&iacute;das del 20% desde principios de 2015 a mediados de 2016 y posterior recuperaci&oacute;n para volver a alcanzar los de aquel entonces.</p>\r\n\r\n<p>Por Miguel Gorelik, Director de&nbsp;<em>Valor Carne</em></p>\r\n\r\n<p><em>Fuente:&nbsp;http://www.valorcarne.com.ar/&nbsp;</em></p>\r\n</div>', '2017-01-31', '1', 'D80CC7E6-BE1E-4763-904E-B43F39DEF5FB');
INSERT INTO `noticia` VALUES ('5', '1', 'Showcase Beef 2016', '<p>El pasado mi&eacute;rcoles 18 de Mayo, recibimos gratamente al segundo grupo de productores conformado aproximadamente por 50 personas provenientes de diferentes partes de Brasil Central, acompa&ntilde;ados por el Director de Alta Genetics Brasil Sr. Everardo Carvalho.</p>', '<p>El pasado mi&eacute;rcoles 18 de Mayo, recibimos gratamente al segundo grupo de productores conformado aproximadamente por 50 personas provenientes de diferentes partes de Brasil Central, acompa&ntilde;ados por el Director de Alta Genetics Brasil Sr. Everardo Carvalho.</p>', '2016-05-18', '1', 'A4CD68A7-24A7-4B54-8428-A10ED4858DED');
INSERT INTO `noticia` VALUES ('6', '1', 'Jornada de IATF para Rodeos de Cría', '<p>El pasado mes, CIALE Alta junto con Zoetis, realizaron las Jornadas de IATF para Rodeos de Cr&iacute;a, las mismas tuvieron lugar en Capit&aacute;n Sarmiento, Provincia de Buenos Aires el d&iacute;a 11 de Mayo y en Riachuelo, Corrientes el d&iacute;a 13 del mes.</p>', '<p>La charla principal, estuvo dictada por Manoel Sa Filho, Gerente de Programas Especiales de Corte de Alta Genetics Brasil, quien abarc&oacute; temas como el desarrollo de las IATFs en Brasil, protocolos, resincronizaci&oacute;n y puntos cr&iacute;ticos de las IATFs, entre otros.<br />\r\nAdem&aacute;s, Joaqu&iacute;n &Aacute;lvarez, Gerente del &aacute;rea de Carne de CIALE Alta, explic&oacute; el inicio del programa Concept Plus Beef en Argentina, sus beneficios y la confiabilidad del mismo.</p>\r\n\r\n<p>Luego del almuerzo y la muestra en la pista, Tom&aacute;s Diaz y Santiago Wallace, explicaron las t&eacute;cnicas para vender las IATFs y el mercado en Argentina.</p>\r\n\r\n<p>Para finalizar con la jornada, el Dr. Juan Loguercio, Jefe de Laboratorio de CIALE Alta, detall&oacute; los procedimientos de congelado y las precauciones requeridas, adem&aacute;s de los est&aacute;ndares de calidad seminal tanto en CIALE como en Alta global.<br />\r\nEntre ambas jornadas contamos con la participaci&oacute;n de m&aacute;s de 300 productores, a quienes agradecemos por participar activamente de la jornada, tanto en Capit&aacute;n Sarmiento como en Corrientes.</p>', '2016-05-11', '1', 'EA0B1CFE-5ADA-48A1-B9DD-8FA6CC1D81A0');
INSERT INTO `noticia` VALUES ('7', '1', 'Día de Campo para productores del NOA', '<p>El d&iacute;a mi&eacute;rcoles 27 de Abril, en Las Lajitas, Salta, se realiz&oacute; el D&iacute;a de Campo para Productores del NOA, organizado junto con Agrobari, Centro Ganadero y la Asoc. Argentina de Brangus.<br />\r\n&nbsp;</p>', '<p>El programa fue muy variado, comenzando con la presentaci&oacute;n del campo, de la mano de Luis Petracchi, luego Eduardo Navamuel brindo una charla sobre las tecnolog&iacute;as de aplicaci&oacute;n en Agrobari y como &uacute;ltimo disertante el Dr. Rodolfo Peralta hizo una rese&ntilde;a sobre las razas sint&eacute;ticas en el NOA.<br />\r\nLuego finalizaron de recorrer las instalaciones para almorzar y conversar sobre las conclusiones obtenidas a lo largo de la jornada.<br />\r\nEn el campo se pudo observar la producci&oacute;n de excelentes toros de CIALE Alta como Don Ciriaco, Independencia, Dakota, Picante, Soberano, Yako, Arang&aacute;, Mulato, entre otros.<br />\r\nAgradecemos a los 200 productores que se acercaron a participar de la jornada.<br />\r\nLes dejamos abajo fotos y videos del evento.</p>\r\n\r\n<p>Agradecer la gentileza a Gem&aacute;n Salom&oacute;n, de Salta Agropecuaria y a Gabriel Varela de Palabra Rural&nbsp;por las notas realizadas!</p>\r\n\r\n<p>http://www.saltaagropecuaria.com.ar/programa-n-512.html</p>\r\n\r\n<p>https://www.facebook.com/163039097070139/photos/a.1191870007520371.1073742241.163039097070139/1191870167520355/?type=3&amp;theater&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/TJTHC3HzpyA\" width=\"640\"></iframe></p>\r\n\r\n<p style=\"text-align:center\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/owWXhWA5GPQ\" width=\"640\"></iframe></p>', '2016-04-27', '1', 'D936A40A-20EF-4A82-8C22-BC1F2F872841');
