INSERT INTO `toro` VALUES ('319', '11', 'Volcan Blackcap 4665 -T/E-', 'ambicioso', 'AMBICIOSO', 'Ciale SA', 'Ciale SA', 'Hijo de Crédito sobre madre Right Time en la 2352 propia hermana de Gran Sudeste de cabaña El Volcán de Los Lazos. Llamó la atención desde ternero por su expresión racial. Combina muy buenos datos con corrección de estructura, largo corporal impresionante y destacada musculatura. Seleccionado para su incorporación a CIALE Alta durante el Beef Showcase 2014. Causó sensación entre los participantes por las características mencionadas. Excelente opción para quienes busquen un toro “de punta” para Peso al Destete (Top 5%) y Final (Top 1%) con datos de carcasa muy buenos especialmente para Ojo de Bife (Top 4%),acompañado de un pedigree consistente. AMBICIOSO ha sido evaluado por el programa Concept Plus donde ha alcanzado excelente desempeño en trabajos de IATF, con resultados de preñez que están por encima del promedio.', '0', '1', 'Stratum 1333 Crédito Discovery -T/E-', 'Volcan Blackcap 3486 -T/E-', 'OCC Discovery 918D', 'Leachman Right Time', 'Black Princess 7480 Puly', 'Sibila Blackcap 2352 -T/E-', 'Rito 9FB3 of 5H11 Fullblaack', 'Erica Lassie of RR 766B', 'SE Turning Point', 'Black Princess 7212 Puly', 'N Bar Emulation EXT', 'Leachman Erica 0025', 'Vermillon Dateline 7078', 'Sibila Laura 34 Lucys -T/E-', 'Programa ERA (Julio 2017)', null, '4665', '794706', 'I1 AA 3186', '2011-08-26', 'S 953', '43 cm', '61 cm', '60 cm', '1,37 m', '1,80 m', '1035 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"-\",\"PN\":\"-0.1\",\"PD\":\"13.1\",\"Leche\":\"0.6\",\"PF\":\"51\",\"CE\":\"1.4\",\"Altura\":\"2.3\",\"AOB\":\"3.2\",\"GD\":\"-0.1\",\"GC\":\"-0.3\",\"GI\":\"0\",\"CM\":\"0.3\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"-\",\"PN\":\"0.85\",\"PD\":\"0.85\",\"Leche\":\"0.64\",\"PF\":\"0.71\",\"CE\":\"0.74\",\"Altura\":\"0.79\",\"AOB\":\"0.7\",\"GD\":\"0.71\",\"GC\":\"0.72\",\"GI\":\"0.72\",\"CM\":\"0.7\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"-\",\"PN\":\"30%\",\"PD\":\"5%\",\"Leche\":\"40%\",\"PF\":\"1%\",\"CE\":\"25%\",\"Altura\":\"25%\",\"AOB\":\"4%\",\"GD\":\"60%\",\"GC\":\"75%\",\"GI\":\"25%\",\"CM\":\"20%\"},{\"rowhead\":\"PROMEDIO\",\"L.Gest.\":\"-0.2\",\"PN\":\"0.0\",\"PD\":\"5.9\",\"Leche\":\"0.4\",\"PF\":\"17.9\",\"CE\":\"1.0\",\"Altura\":\"1.6\",\"AOB\":\"0.5\",\"GD\":\"0.2\",\"GC\":\"0.3\",\"GI\":\"0.0\",\"CM\":\"-0.1\"}],\"Aberdeen Angus Negro BREEDPLAN\":[{\"rowhead\":\"DEP\",\"FPD\":\"\",\"FPDh\":\"\",\"LG\":\"\",\"PN\":\"\",\"PD\":\"\",\"P.Año\":\"\",\"PF\":\"\",\"P.Vaca\":\"\",\"Leche\":\"\",\"CE\":\"\",\"P.Carcasa\":\"\",\"AOB\":\"\",\"GD\":\"\",\"GC\":\"\",\"Rend\":\"\",\"GIM\":\"\",\"IP\":\"\"},{\"rowhead\":\"PREC\",\"FPD\":\"\",\"FPDh\":\"\",\"LG\":\"\",\"PN\":\"\",\"PD\":\"\",\"P.Año\":\"\",\"PF\":\"\",\"P.Vaca\":\"\",\"Leche\":\"\",\"CE\":\"\",\"P.Carcasa\":\"\",\"AOB\":\"\",\"GD\":\"\",\"GC\":\"\",\"Rend\":\"\",\"GIM\":\"\",\"IP\":\"\"},{\"rowhead\":\"RANKING\",\"FPD\":\"\",\"FPDh\":\"\",\"LG\":\"\",\"PN\":\"\",\"PD\":\"\",\"P.Año\":\"\",\"PF\":\"\",\"P.Vaca\":\"\",\"Leche\":\"\",\"CE\":\"\",\"P.Carcasa\":\"\",\"AOB\":\"\",\"GD\":\"\",\"GC\":\"\",\"Rend\":\"\",\"GIM\":\"\",\"IP\":\"\"},{\"rowhead\":\"PROMEDIO\",\"FPD\":\"\",\"FPDh\":\"\",\"LG\":\"\",\"PN\":\"\",\"PD\":\"\",\"P.Año\":\"\",\"PF\":\"\",\"P.Vaca\":\"\",\"Leche\":\"\",\"CE\":\"\",\"P.Carcasa\":\"\",\"AOB\":\"\",\"GD\":\"\",\"GC\":\"\",\"Rend\":\"\",\"GIM\":\"\",\"IP\":\"\"}]}', '43', '340', null, '750', 'F254C428-0412-47F3-BE80-AB539A9CAA22', 'Credito X Right Time', '1', '1', 'ARG ', null);
INSERT INTO `toro` VALUES ('321', '11', 'Piray 1144 Pionner Lalit -T/ER', 'astor', 'ASTOR', 'La Torcacita de Piray Miní', 'CIALE S.A.', 'Destacado hijo de Pioneer en madre Nichols Performa, también se destacan en su pedigree Sacarías y Tres Marías 4864 Wind Ext. Astor combina precocidad y facilidad de engrasamiento con números de crecimiento y carcasa sobresalientes, especialmente para AOB. Fue elegido Campeón 2 años Menor en la Expo de Otoño 2013. Sus primeras crías en La Torcacita se destacan por su corrección y precocidad.', '0', '1', 'S A V Pioneer 7301', 'Black Princess 9926 Vengadora-T/E-', 'S A V Final Answer 0035', 'Nichols Performa D162', 'S A V Blackbird 5297', 'Tres Marias 5722 Vengadora-T/E', 'Sitz Traveler 8180', 'S V A Emulous 8145', 'Boyd New Day 8005', 'S A V Blackbird 1082', 'Nichols Formula U193', 'Nichols Lula B87', 'Tres Marias 4955 Sacarias-T/E', 'Tres Marias 4864 Wind Ext-T/EC', 'Programa ERA (Julio 2017)', null, '1144', '792583', 'I1 AA 3086', '2011-07-22', 'S 954', '41 cm', '60 cm', '62 cm', '1,37 m', '1,65 m', '1080 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"-0.5\",\"PN\":\"-0.2\",\"PD\":\"11.1\",\"Leche\":\"2.1\",\"PF\":\"40.6\",\"CE\":\"1.5\",\"Altura\":\"2.8\",\"AOB\":\"2\",\"GD\":\"2.3\",\"GC\":\"3.3\",\"GI\":\"0.2\",\"CM\":\"-3.6\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"0.67\",\"PN\":\"0.85\",\"PD\":\"0.85\",\"Leche\":\"0.62\",\"PF\":\"0.78\",\"CE\":\"0.85\",\"Altura\":\"0.85\",\"AOB\":\"0.76\",\"GD\":\"0.77\",\"GC\":\"0.78\",\"GI\":\"0.77\",\"CM\":\"0.76\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"30%\",\"PN\":\"30%\",\"PD\":\"10%\",\"Leche\":\"25%\",\"PF\":\"5%\",\"CE\":\"20%\",\"Altura\":\"10%\",\"AOB\":\"15%\",\"GD\":\"5%\",\"GC\":\"1%\",\"GI\":\"1%\",\"CM\":\"95%\"},{\"rowhead\":\"PROMEDIO\",\"L.Gest.\":\"-0.2\",\"PN\":\"0.0\",\"PD\":\"5.9\",\"Leche\":\"0.4\",\"PF\":\"17.9\",\"CE\":\"1.0\",\"Altura\":\"1.6\",\"AOB\":\"0.5\",\"GD\":\"0.2\",\"GC\":\"0.3\",\"GI\":\"0.0\",\"CM\":\"-0.1\"}],\"Aberdeen Angu