INSERT INTO `toro` VALUES ('325', '11', 'Filomena 403 Maxi 16-T/E-', 'chumbo', 'CHUMBO', 'Cabaña La Filomena, Simonetti Eugenio', 'CIALE S.A.', 'Chumbo es una incorporación de lujo. Fue Campeón Ternero en Otoño 2014. Desde su corta edad se muestra como un reproductor precoz e imponente con estructura correcta y gran calidad racial. Cuando decidimos incorporar a Chumbo fue por los excelentes resultados que nos dio su propio hermano Vistoso. Al igual que éste, Chumbo mejora mucho las cabezas y el frente, aportando gran calidad racial pero además aporta gran volumen y cuartos posteriores a su progenie. Si usted utilizo Vistoso y quedo conforme, Chumbo es sin dudas el toro para continuar su plan genético.', '0', '1', 'Don José 176 Maxi -T/E-', 'Filomena 16 Credito Jockey', 'OCC Headliner 661H', 'Stratum 1333 Crédito Discovery -T/E-', 'Tres Marias 6204 Hornero', 'La Segunda 11271 Erika', 'OCC Emblazon 854E', 'OCC Juanada 858F', 'Tres Marias 5887 Hornero', 'Tres Marias 5314 Soyadora', 'OCC Discovery 918D', 'Black Princess 7480 Puly', 'OCC Jockey 655J', 'La Segunda 9747 Raquel', 'Programa ERA (Julio 2017)', null, '403', '811246', 'I1 AA 3297', '2013-03-17', 'S 966', '40 cm', '59 cm', '60 cm', '1,4 m', '1,77 m', '1055 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"-\",\"PN\":\"0.2\",\"PD\":\"6.6\",\"Leche\":\"1.7\",\"PF\":\"25.7\",\"CE\":\"0.6\",\"Altura\":\"0\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"-\",\"PN\":\"0.05\",\"PD\":\"0.05\",\"Leche\":\"0.05\",\"PF\":\"0.05\",\"CE\":\"0.05\",\"Altura\":\"0.05\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"-\",\"PN\":\"45%\",\"PD\":\"45%\",\"Leche\":\"25%\",\"PF\":\"25%\",\"CE\":\"75%\",\"Altura\":\"90%\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"PROMEDIO\",\"L.Gest.\":\"-0.2\",\"PN\":\"0.0\",\"PD\":\"5.9\",\"Leche\":\"0.4\",\"PF\":\"17.9