INSERT INTO `toro` VALUES ('326', '11', 'Huaca Curú 7210 Zorzal 5795 -T/E-', 'curú', 'CURÚ', 'JYA Blanco Villegas', 'CIALE S.A.', 'Posee un extraordinario sello racial, imponente volumen corporal, gran corrección estructural, profundidad y balance. Realmente todo un padre. Concurren sus crías a Palermo 2016. Gran respaldo genético, combina por padre a Zorzal, sin ninguna duda uno de los toros más importantes en la historia del Angus. Ganador del Ranking de Padres desde los años 2008 al 2013 y de Abuelo Materno desde 2011 al 2013 en Argentina y Padre del Año en Brasil en los últimos 6 años, manteniéndose además en el tope en los EPD´s de ese país. Su madre la 5795, hija de Net Worth, de excelentes EPD´s de crecimiento, habilidad materna y carcasa, quien combina a grandes padres como son Traveler 004, su abuelo materno Bando 5175, gran productor de hembras, quienes se destacan por su habilidad materna, y su bisabuelo el Rito 9FB3, de sobresalientes EPD´s de carcasa, y más atrás lleva los genes de Future Direction.', '0', '1', 'Tres Marías 6301 Zorzal', 'Huaca Curu 5795 Net Worth 10', 'Tres Marías 5887 Hornero', 'S A V Net Worth 4200', 'Tres Marías 4850 Wind EXT', 'Black Princess 10960 G.GIRL 9400 -T/E-', 'Tres Marías 4955 Sacarias', 'Tres Marías 5116 Founder', 'Westwind Rito 8503 D J H', 'Tres Marías 4454 Erica 1', 'S A V 8180 Traveler 004', 'S A V May 2410', 'C A Future Direction 5321', 'Black Princess 9400 Golde', 'Programa ERA (Julio 2017)', null, '7210', '811363', 'En Trámite', '2013-05-26', 'En Trámite', '42 cm', '60 cm', '66 cm', '1,49 m', '1,89 m', '1150 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"-0.1\",\"PN\":\"0.3\",\"PD\":\"9\",\"Leche\":\"2.7\",\"PF\":\"25.8\",\"CE\":\"0.8\",\"Altura\":\"2.6\",\"AOB\":\"-1.4\",\"GD\":\"0.6\",\"GC\":\"0.2\",\"GI\":\"0\",\"CM\":\"-1.2\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"0.63\",\"PN\":\"0.81\",\"PD\":\"0.78\",\"Leche\":\"0.63\",\"PF\":\"0.7\",\"CE\":\"0.76\",\"Altura\":\"0.84\",\"AOB\":\"0