INSERT INTO `toro` VALUES ('379', '11', 'El Abra Jewlian 7579', 'jewlian 7579', 'JEWLIAN 7579', 'El Hinojo de Emilio J. Bru', 'El Hinojo de Emilio J. Bru', 'Hacía mucho tiempo que queríamos sumar estás líneas clásicas 100% escocesas a nuestra ofertas de toros padres. En nuestra búsqueda visitamos la cabaña El Hinojo de Bru a quienes agradecemos por ofrecernos la posibilidad de incorporar este verdadero padre de la cabaña que ha estado en servicio hasta el día que lo vimos. Nacido en 2008, el JEWLIAN 7579 llega a CIALE Alta para cubrir las necesidades de aquellos productores que priorizan extrema facilidad de parto, mucha precocidad y facilidad de engrasamiento, moderación, tremenda pureza racial y sobretodo mucha consistencia. Padre de muchos toros que se han vendido en los remates de la cabaña e hijo del Jewlian 4491 sobre una madre Haymount 4480, es un toro sumamente probado para utilizar en Vaquillonas de 15 meses. El \"7579\" representa una oprtunidad única de utilizar éstas líneas genéticas originales escocesas.', '1', '1', 'El Abra Jewlian 4491', 'El Abra Princess Jennie 6534', 'El Abra Yewlian 3905', 'El Abra Haymount 4480', 'El Abra Squart Barre 3973', 'El Abra Princess Jennie 4514', 'Newhouse Jewlian Eric 125Th', 'El Abra Duchess Rance 3816', 'El Abra Jewlian 3422', 'El Abra Squartbarre 3243', 'El Abra Haymount 2503', 'El Abra Duchess Eronasa 2704', 'El Abra Yewlian 3920', 'El Abra Princess Jennie 3263', 'Programa ERA (Julio 2017)', '15', '7579', '778362', 'En Trámite', '0008-05-12', 'N 175179', '40 cm', '58 cm', '57 cm', '1,33 m', '1,68 m', '870 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"\",\"PN\":\"-\",\"PD\":\"-\",\"Leche\":\"-\",\"PF\":\"-\",\"CE\":\"-\",\"Altura\":\"-\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"-\",\"PN\":\"-\",\"PD\":\"-\",\"Leche\":\"-\",\"PF\":\"-\",\"CE\":\"-\",\"Altura\":\"-\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":