INSERT INTO `toro` VALUES ('380', '11', 'Cassina 1084 Xander Luminoso -T/E-', 'lucero', 'LUCERO', 'La Cassina S.A.', 'La Cassina S.A.', 'Lucero, recientemente incorporado a CIALE Alta es un toro que impresiona por su correción y expresion racial. Muy destacadas masas musculares, extrema corrección y aspecto blando. Combina OCC Xander (Missing Link x Traveler 6807) en una madre con ascendencia Haymount. Creemos que Lucero es una opción para quienes siguen la genetica OCC y modelos de producción a pasto que deben mantener el tamaño adulto de sus vacas, y producir terneros de fácil engorde en esas condiciones. Incluiremos a Lucero en el programa de pruebas a campo para bajo peso al nacer este año.', '1', '1', 'O C C Xander 781X', 'Black Princess 11722 Beauty', 'O C C Missing Link 830M', 'Surangus Fogonazo 0427 -T/E-', 'O C C Dicie Erica 612H', 'Black Princess 10628 Beauty -T/E-', 'O C C Headliner 661H', 'O C C Dicie Erica 946K', 'D H D Traveler 6807', 'O C C Dixie Erica 803F', 'El Abra Haymount 4180', 'surangus Blackbird 008-T/E/I-', 'Tc Stockman 365', 'Black Princess 9182 Beauty-T/E-', 'Programa ERA (Julio 2017)', null, '1084', '823072', 'En Trámite', '0016-03-05', 'N 241314', '38 cm', '53 cm', '56 cm', '1,36 m', '1,63 m', '780 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"-0.4\",\"PN\":\"0.4\",\"PD\":\"1.8\",\"Leche\":\"0.8\",\"PF\":\"2.1\",\"CE\":\"0.8\",\"Altura\":\"0\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"0.6\",\"PN\":\"0.64\",\"PD\":\"0.05\",\"Leche\":\"0.05\",\"PF\":\"0.05\",\"CE\":\"0.05\",\"Altura\":\"0.05\",\"AOB\":\"-\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"30%\",\"PN\":\"60%\",\"PD\":\"80%\",\"Leche\":\"40%\",\"PF\":\"85%\",\"CE\":\"65%\",\"Altura\":\"90%\",\"AOB\":\"\",\"GD\":\"-\",\"GC\":\"-\",\"GI\":\"-\",\"CM\":\"-\"},{\"rowhead\":\"PROMEDIO\",\"L.Gest.\":\"-0.2\",\"PN\":\"0.0\",\"PD\":\"5.9\",\"Leche\":