INSERT INTO `toro` VALUES ('415', '16', 'Connealy Contractor', 'contractor', 'CONTRACTOR', 'Connealy Angus Ranch, Whitman NE', 'T K Angus, Wood Lake NE', 'Contractor es sin dudas un hallazgo genético! Hace tiempo que estábamos buscando un Angus de estas características. Contractor es un toro sumamente probado con tremendos datos y un pedigree muy consistente (Final Answer x New Desing 208). Posee una excelente facilidad de parto acompañada por un superlativo crecimiento al destete y al año. Sus datos para CE, Leche y Marmoreo son sobresalientes como así también su extrema Docilidad y el tamaño moderado de sus hijas. Varios de sus hijos han sido precio máximo en varias cabañas en 2015, como TK Angus en Nebraska, Penz Angus y Albercht Angus en Oklahoma. Si usted está buscando incorporar un toro Curve Bender que lo tenga todo, Contractor es sin dudas el toro ideal para mejorar los índices productivos de su rodeo.', '0', '1', 'S A V Final Answer 0035', 'Ela of Conanga 868 11', 'Sitz Traveler 8180', 'Bon View New Design 208', 'S A V Emulous 8145', 'Eligence Plus of Conanga', 'G D A R Traveler 71', 'Sitz Everelda Entense 1137', 'Bon View Bando 598', 'S A V Sky Emulous 2124', 'B/R New Design 036', 'Bon View Erica 443', 'TC Dividend 963', 'Eura Cap of Conanga', 'American Angus Association (Junio 2017)', '15', 'SI 9510', '830089', 'S.I.', '2009-04-02', 'I 9077', '43,5 cm', '53 cm', '56 cm', '1,40 m', '1,80 m', '970 kg', null, '{\"American Angus Association (Junio 2017)\":[{\"rowhead\":\"DEP\",\"FPD\":\"17\",\"PN\":\"-2.4\",\"PD\":\"62\",\"P.Año\":\"113\",\"Ef.C\":\"0.23\",\"CMS\":\"0.08\",\"Alt.Año\":\"0.8\",\"CE\":\"1.79\",\"Doc.\":\"13\",\"%PH.\":\"2.9\",\"FPHijas\":\"15\",\"Leche\":\"31\",\"PAHijas\":\"22\",\"Alt.Hijas\":\"-0.1\",\"$EN\":\"-19.61\",\"P.Carc\":\"20\",\"Marm.\":\"0.84\",\"AOB\":\"0.30\",\"GD\":\"0.143\",\"$W\":\"72.18\",\"$F\":\"84.42\",\"$B\":\"84.75\"},{\"rowhead\":\"PREC\",\"FPD\":\"0.8\",\"PN\":\"0.85\",\"PD\":\"0.83\",\"P.Año\":\"0.77\",\"Ef.C\":\"0.47