INSERT INTO `toro` VALUES ('419', '16', 'Baldridge Hickory', 'Hickory', 'HICKORY', 'Judson & Denise Baldridge', 'Alta Genetics Inc W B D, Rocky View County AB Canada', 'Imperdible opción para utilizar sobre Vaquillonas de 15 meses. Adquirido por Alta Genetics en el remate de Baldrige Angus Ranch en 2017. Hijo de un verdadero “vacón” y tal vez la vaca más productiva de la cabaña, la famosa Isabel Y69 quien fuera madre de varios toros que se encuentran en centrales de IA. Su conocido padre (Hickok 7242) viene por la línea del popular Consensus. Hickory es otro toro Curve Bender que se suma a nuestra batería con sobresalientes datos de crecimiento, Docilidad, buena producción de Leche de sus hijas y tremendos datos de carcasa. Todo esto en un tamaño sumamente moderado; útil para masificar en todo tipo de rodeo tanto en vacas como en vaquillonas.', '1', '1', 'Mill Bar Hickok 7242', 'Baldridge Isabel Y69', 'Connealy Consensus 7229', 'Styles Upgrade J59', 'Mill Bar Bemindful Maid 6304', 'Baldridge Isabel T935', 'Connealy Consensus', 'Blue Lilly of Conanga 16', 'S A V Final Answer 0035', 'Mill Bar Lady DI 3400', 'Sitz Upward 307R', 'Plainview Lassie 71B', 'Baldridge Kaboom K243 KCF', 'Baldridge Isabel P4527', 'American Angus Association (Junio 2017)', '15', 'SI D746', 'En Trámite', 'Semen Importado', '0017-03-02', 'En Trámite', '40 cm', '-', '-', '-', '-', '750 kg', null, '{\"American Angus Association (Junio 2017)\":[{\"rowhead\":\"DEP\",\"FPD\":\"17\",\"PN\":\"-2.9\",\"PD\":\"63\",\"P.Año\":\"105\",\"Ef.C\":\"0.16\",\"CMS\":\"0.41\",\"Alt.Año\":\"0.1\",\"CE\":\"0.63\",\"Doc.\":\"33\",\"%PH.\":\"23.4\",\"FPHijas\":\"14\",\"Leche\":\"29\",\"PAHijas\":\"29\",\"Alt.Hijas\":\"0.4\",\"$EN\":\"-13.11\",\"P.Carc\":\"46\",\"Marm.\":\"1.06\",\"AOB\":\"1.25\",\"GD\":\"0.101\",\"$W\":\"76.15\",\"$F\":\"60.78\",\"$B\":\"143.01\"},{\"rowhead\":\"PREC\",\"FPD\":\"0.34\",\"PN\":\"0.39\",\"PD\":\"0.32\",\"P.Año\":\"0.36\",\"Ef.C\":\"0.33\",\"CMS\":\"0.33\",\"Alt.Año\":\"0.4\",\"CE\":\"0.