INSERT INTO `toro` VALUES ('420', '16', 'Ellingson Icon 5062', 'Icon', 'ICON', 'Chad & Julie Ellingson', 'Alta Genetics Inc W B D, Rocky View County AB Canada', 'Nueva incorporación en Angus Importado. Proveniente de Ellingson Angus Ranch, ICON llega para sumarse al segmento de toros extremos para el servicio de 15 meses; en este caso en un biotipo bien moderado y con gran calidad racial. Ideal para aquellos que quieran incorporar Facilidad de parto en su rodeo (TOP 1% para FP de las hijas), hembras con bajos requerimientos y bien mantenidas (TOP 25% para $EN); marcada Area de Ojo de Bife (TOP 1% para AOB) y buen engrasamiento (TOP 5% para GD). Hijo de Ellingson Identity en una madre Cowboy, ICON está siendo utilizado masivamente en los programas de IATF en vaquillonas de USA.', '1', '1', 'Ellingson Identity 9104', 'EA Emblynette 3311', 'TC Aberdeen 759', 'Boyd Cowboy 908', 'EA Queen Dolly 7813', 'EA Emblynette 0030', 'C R A Bextor 872 5205 608', 'TC Blackbird 4034', 'Wulffs Ext 6106', 'EA Queen Dolly 5029', 'S A V Net Worth 4200', 'BT Everelda Entense 43J', 'LT Territory 5824 of EA', 'EA Emblynette 429', 'American Angus Association (Junio 2017)', '15', 'SI 5062', 'En Trámite', 'Semen Importado', '0016-11-02', 'En Trámite', '42 cm', '51 cm', '55 cm', '1,29 m', '1,65 m', '980 kg', null, '{\"American Angus Association (Junio 2017)\":[{\"rowhead\":\"DEP\",\"FPD\":\"17\",\"PN\":\"-1.7\",\"PD\":\"48\",\"P.Año\":\"88\",\"Ef.C\":\"0.17\",\"CMS\":\"0.28\",\"Alt.Año\":\"-0.2\",\"CE\":\"1.12\",\"Doc.\":\"7\",\"%PH.\":\"9.4\",\"FPHijas\":\"16\",\"Leche\":\"25\",\"PAHijas\":\"-8\",\"Alt.Hijas\":\"0.2\",\"$EN\":\"2.62\",\"P.Carc\":\"33\",\"Marm.\":\"0.34\",\"AOB\":\"0.82\",\"GD\":\"0.049\",\"$W\":\"58.26\",\"$F\":\"43.2\",\"$B\":\"102.62\"},{\"rowhead\":\"PREC\",\"FPD\":\"0.38\",\"PN\":\"0.44\",\"PD\":\"0.33\",\"P.Año\":\"0.36\",\"Ef.C\":\"0.33\",\"CMS\":\"0.33\",\"Alt.Año\":\"0.36\",\"CE\":\"0.47\",\"Doc.\":\"0.28\",\"%PH.\":\"0.25\",\"FPHijas\":\"0.14\",\"Leche\":\"0.22\",\"PA