INSERT INTO `toro` VALUES ('429', '16', 'S A V Topsoil 4354', 'topsoil', 'TOPSOIL', 'Schaffs Angus Valley, Saint Anthony ND', 'Alta Genetics Inc. y otros', 'Impresionante fenotipo que combina tremendos números y un sólido pedigree. Topsoil es un padre como pocos; ideal para producir machos y hembras con amplios cuartos posteriores, carcasas bien pesadas y buena estructura. Sus DEPs son impecables! posee extremo crecimiento con moderación en el tamaño adulto de sus crías; también mejora las ubres y producción de leche de las hembras, así como también el tamaño testicular de los machos. Como si fuera poco, también es un gran mejorador de calidad de res y posee una extrema eficiencia de conversión.', '0', '1', 'S A V Harvestor 0338', 'S A V Emblynette 9044', 'S  A V Heritage 6295', 'S A V Bismarck 5682', 'S A V Emblynette 7749', 'S A V Emblynette 5573', 'CAR Duke 104', 'S A V Blackcap May 4136', 'S A V Net Worth 4200', 'Sav Emblynette Diamond 6377', 'G A R Grid Maker', 'S A V Abigale 0451', 'S A V 8180 Traveler 004', 'S A V Emblynette 1182', 'American Angus Association (Junio 2017)', null, 'SI 4354', 'En Trámite', 'S.I.', '2015-04-03', 'En Trámite', '43 cm', '62 cm', '64 cm', '1,43 m', '1,82 cm', '1095 kg', null, '{\"American Angus Association (Junio 2017)\":[{\"rowhead\":\"DEP\",\"FPD\":\"5\",\"PN\":\"3.6\",\"PD\":\"73\",\"P.Año\":\"123\",\"Ef.C\":\"0.27\",\"CMS\":\"0.07\",\"Alt.Año\":\"0.5\",\"CE\":\"1.26\",\"Doc.\":\"6\",\"%PH.\":\"16.6\",\"FPHijas\":\"9\",\"Leche\":\"28\",\"PAHijas\":\"5\",\"Alt.Hijas\":\"0.2\",\"$EN\":\"-12.62\",\"P.Carc\":\"45\",\"Marm.\":\"0.77\",\"AOB\":\"0.62\",\"GD\":\"0.048\",\"$W\":\"76.26\",\"$F\":\"95.79\",\"$B\":\"145.38\"},{\"rowhead\":\"PREC\",\"FPD\":\"0.48\",\"PN\":\"0.67\",\"PD\":\"0.55\",\"P.Año\":\"0.36\",\"Ef.C\":\"0.34\",\"CMS\":\"0.34\",\"Alt.Año\":\"0.38\",\"CE\":\"0.43\",\"Doc.\":\"0.34\",\"%PH.\":\"0.24\",\"FPHijas\":\"0.19\",\"Leche\":\"0.25\",\"PAHijas\":\"0.34\",\"Alt.Hijas\":\"0.16\",\"$EN\":\"-\",\"P.Carc\":\"0.22\",\"M