INSERT INTO `toro` VALUES ('463', '17', 'Casamu 280 Arecutran Jewlian', 'chaitun', 'CHAITÚN', 'Casamu S.A.', 'Casamu S.A.', 'Una combinación única, que complementa la facilidad de parto y un buen crecimiento con buena musculatura y facilidad de engorde en un excelente y atractivo biotipo. Todo esto es posible gracias a los aportes genéticos de Arecutrán (padre) y Jewlian (x madre). Chaitún es un toro ampliamente probado, de altura moderada pero muy ancho y musculoso. Es un toro ideal para garantizar facilidad de parto. De bajo peso al nacer pero muy buen desarrollo posterior lo que lo convierte en un verdadero “curve bender”. Recomendamos esta joya genética! Los primeros terneros nacidos sobre Vaquillonas de 15 meses en su cabaña de origen pesaron en promedio 25,3kg las Hembras y 27kg los Machos.', '0', '1', 'Casamu 7824 Lihuen Rollizo', 'Casamu 7333 Jewliana Sophie 4403', 'Casamu 5622 Leader Jewlian', 'El Abra Yewlian 4214', 'Casamu 5541 Rolliza Kuruba 2375', 'Casamu 4403 Krata Sophie 1243', 'O C C Headliner 661H', 'Casamu 4407 Jewliana Lady 2335', 'Casamu 3640 Potencia Copper', 'Casamu 2375 Iporazo Kuruba758', 'El Abra Yewlian 1953', 'El Abra Duchess Rance 3261', 'Casamu 2790 Contra Sólido', 'Casamu 1243 Heaverly Sophie 257-T/E-', 'Programa ERA (Julio 2017)', '15', '280', '792895', 'En Trámite', '2011-10-18', 'N 209351', '41 cm', '55 cm', '58 cm', '1,33 m', '1,75 m', '930 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"0.3\",\"PN\":\"-3.1\",\"PD\":\"8.5\",\"Leche\":\"-0.1\",\"PF\":\"19.3\",\"CE\":\"-0.1\",\"Altura\":\"-\",\"AOB\":\"1\",\"GD\":\"0.3\",\"GC\":\"0.8\",\"GI\":\"-0.1\",\"CM\":\"-0.5\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"0.48\",\"PN\":\"0.64\",\"PD\":\"0.64\",\"Leche\":\"0.54\",\"PF\":\"0.64\",\"CE\":\"0.64\",\"Altura\":\"-\",\"AOB\":\"0.64\",\"GD\":\"0.64\",\"GC\":\"0.64\",\"GI\":\"0.64\",\"CM\":\"0.64\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"75%\",\"PN\":\"1%\",\"PD\":\"25%\",\"Leche\":\"65%\",\"PF\":\"45%\",\"CE\":\"95