INSERT INTO `toro` VALUES ('472', '17', 'Tapayú 3329 Cacique', 'loncopue', 'LONCOPUÉ', 'Chañar Chico de Teso S.A.', 'Chañar Chico de Teso S.A.', 'Sus medidas corporales son óptimas, con buen largo corporal y buen ancho y largo de grupa. Tiene tamaño moderado, es muy precoz y tiene marcada consistencia y calidad racial. Combina muy bien facilidad de engorde, volumen corporal y musculatura. Muy recomendable para moderar tamaño en rodeos comerciales y puro controlados e incorporar fertilidad y calidad \"Angus\". Muy destacado hijo de Cacique en madre Non Better.', '0', '1', 'Tapayú 2179 Oriental', 'Tapayú 1838 Invatible 15-99', 'Doblehache 33 Oriental -T/E-', 'Tapayú 1599 None Better', 'Tapayú 1532 Rab Rock -T/E-', 'Tapayú 1532 Rab Rock -T/E-', 'Red Flying K Dynamo 6Y', 'Buf Crk Lass 1973', 'Rab Rock 129H 250', 'TapayÃº 604 Highlite', 'Basin None Better 361E', 'TapayÃº 1248 Choctaw 6205 -T/E-', 'Rab Rock 129H 250', 'TapayÃº 604 Highlite', 'Programa ERA (Julio 2017)', null, '3329', '771122', 'I1 AA 2873', '2008-08-18', '157748', '41 cm', '60 cm', '60 cm', '1,35 m', '1,76 m', '970 Kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"-1\",\"PN\":\"-0.1\",\"PD\":\"8.1\",\"Leche\":\"-2.6\",\"PF\":\"14.9\",\"CE\":\"0.6\",\"Altura\":\"0.7\",\"AOB\":\"-5.9\",\"GD\":\"-0.2\",\"GC\":\"-0.2\",\"GI\":\"-0.1\",\"CM\":\"-0.2\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"0.65\",\"PN\":\"0.76\",\"PD\":\"0.56\",\"Leche\":\"0.49\",\"PF\":\"0.38\",\"CE\":\"0.74\",\"Altura\":\"0.78\",\"AOB\":\"0.63\",\"GD\":\"0.64\",\"GC\":\"0.67\",\"GI\":\"0.63\",\"CM\":\"0.63\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"15%\",\"PN\":\"30%\",\"PD\":\"30%\",\"Leche\":\"90%\",\"PF\":\"65%\",\"CE\":\"75%\",\"Altura\":\"80%\",\"AOB\":\"95%\",\"GD\":\"10%\",\"GC\":\"10%\",\"GI\":\"70%\",\"CM\":\"55%\"},{\"rowhead\":\"PROMEDIO\",\"L.Gest.\":\"-0.2\",\"PN\":\"0.0\",\"PD\":\"5.9\",\"Leche\":\"0.4\",\"PF\":\"17.9\",\"CE\":\"1.0\",\"Altura\":\"1.6\",\"AOB\":\"0.5\",\"GD\":\"0.2\",\"GC\":\"0.2\",\"GI