INSERT INTO `toro` VALUES ('476', '17', 'Pastoriza 1379 Nacho', 'nacho', 'NACHO', 'Cab. La Pastoriza de El Madrigal S.R.L', 'El Madrial S.R.L., LArachide S.A., CIALE S.A.', 'Por donde se mire Nacho es el toro que todo criador comercial quiere: moderado de tamaño, correctísimo, con muy buenos datos y características raciales impecables. Combina además a la 312 con la 578 una de sus hijas más consistentes. Nacho tiene todo para ser un toro padre de excepción. Su producción es sobresaliente tanto en cabañas como en rodeos comerciales. Aporta gran calidad racial mejorando cabezas, inserción de cuello y paletas. Imprime tremendos cuartos posteriores y gran masculinidad en los machos, así cómo también hembras muy femeninas. Atención con este futuro padre de la raza!', '0', '1', 'Pastoriza 565 Brigadier-T/E-', 'Pastoriza 938 Nacha-T/E-', 'Doblehache 33 Oriental-T/E-', 'Webr Doc Holliday 2N', 'Pastoriza 312 Naranja-T/E', 'Pastoriza 578 Nicolasa-T/E-', 'Red Flying K Dynamo 6Y', 'Buf Crk Lass 1973', 'Don Pancho 59 Mambo -T/E-', 'Don Pancho 34 Indep Chief', 'Mlk Crk Cub 722', 'Webr Ms Dolly 1L', 'Red Flying K Dynamo 6Y', 'Pastoriza 312 Naranja-T/E', 'Programa ERA (Julio 2017)', null, '1379', '805532', 'I1 AA 3194', '2012-11-01', 'N 202475', '41cm', '52cm', '53cm', '1,22m', '1,57m', '780 kg', null, '{\"Aberdeen Angus Negro ERA\":[{\"rowhead\":\"DEP\",\"L.Gest.\":\"1.1\",\"PN\":\"1.4\",\"PD\":\"10.6\",\"Leche\":\"-0.1\",\"PF\":\"30.6\",\"CE\":\"1.3\",\"Altura\":\"2\",\"AOB\":\"1.2\",\"GD\":\"-0.3\",\"GC\":\"-0.5\",\"GI\":\"-0.1\",\"CM\":\"1.2\"},{\"rowhead\":\"PREC\",\"L.Gest.\":\"0.8\",\"PN\":\"0.93\",\"PD\":\"0.9\",\"Leche\":\"0.63\",\"PF\":\"0.81\",\"CE\":\"0.88\",\"Altura\":\"0.92\",\"AOB\":\"0.74\",\"GD\":\"0.75\",\"GC\":\"0.76\",\"GI\":\"0.74\",\"CM\":\"0.74\"},{\"rowhead\":\"RANKING\",\"L.Gest.\":\"95%\",\"PN\":\"95%\",\"PD\":\"15%\",\"Leche\":\"65%\",\"PF\":\"15%\",\"CE\":\"30%\",\"Altura\":\"40%\",\"AOB\":\"30%\",\"GD\":\"2%\",\"GC\":\"3%\",\"GI\":\"70%\",\"CM\":\"2%\"