INSERT INTO `toro` VALUES ('480', '18', 'Rose´s Good One 53', 'good one', 'GOOD ONE', 'Pitchfork- T Ranch, LLC', 'ALTA GENETICS, INC. WBD', 'Excelente alternativa en Angus Colorado proveniente del programa Alta Beef. Nieto del gran Beckton Julian, uno de los toros más consistentes que ha existido en el mercado del Angus Colorado importado. Musculoso, largo, de pelo corto y con una buena cabeza que marca su expresión bien masculina. Sus datos lo muestran como un toro apto para utilizar sobre vaquillonas; ideal para mejorar la tasa de preñez, producción de leche y longevidad de sus hijas en el rodeo. Gran mejorador de AOB. Good One es una sobresaliente alternativa para abrir sangre en el Angus Colorado Argentino, utilizando líneas seguras y predecibles.', '1', '1', 'Messmer Jericho W041', 'Pch Ruby Expectation', 'Beckton Julian GG B571', 'LSF Jbob Expectation 6034S', 'Messmer Pandora M186', 'Pitchfork Ruby Canyon', 'BKT Julian 7526', ' BKT Marta 9A13 JL', 'Leland Marias 271K', 'Messmer Pandora 9976', '  LCHMN Enterprise 1370H', 'LSF Sweetness J1358', 'BFCK Cherokee CNYN 4912', 'CD BAR Ruby 1028', 'Red Angus Association (Junio 2017)', null, 'SI 53', 'En Trámite', 'Semen importado', '0013-01-01', 'En Trámite', '40 cm', '56 cm', '53 cm', '1,30 m', '1,78 m', '920 kg', null, '{\"Red Angus Association Importado\":[{\"rowhead\":\"DEP\",\"FPD\":\"9.0\",\"PN\":\"-3.9\",\"PD\":\"56.0\",\"P.Año\":\"81.0\",\"Lecha\":\"32.0\",\"%PH\":\"15.0\",\"FPHijas\":\"3.0\",\"STAY\":\"16.0\",\"Marm\":\"0.6\",\"Rend\":\"-0.1\",\"P.Carcasa\":\"12.0\",\"AOB\":\"0.4\",\"Grasa\":\"0.0\"},{\"rowhead\":\"PREC\",\"FPD\":\"31\",\"PN\":\"40\",\"PD\":\"34\",\"P.Año\":\"36\",\"Lecha\":\"27\",\"%PH\":\"26\",\"FPHijas\":\"36\",\"STAY\":\"40\",\"Marm\":\"31\",\"Rend\":\"24\",\"P.Carcasa\":\"30\",\"AOB\":\"24\",\"Grasa\":\"31\"},{\"rowhead\":\"RANKING\",\"FPD\":\"25%\",\"PN\":\"20%\",\"PD\":\"55%\",\"P.Año\":\"65%\",\"Lecha\":\"10%\",\"%PH\":\"15%\",\"FPHijas\":\"55%\",\"STAY\":\"2%\",\"Marm\":\"30%\",\"Rend\":\"15%\",\"P.Carcasa\":\"70%\",\"AOB\":\"15%\",\"Grasa\":\"55%\"},{\"rowhead\":\"PROMEDIO\",\"FPD\":\"5\",\"PN\":\"-1.6\",\"PD\":\"59\",\"P.Año\":\"91\",\"Lecha\":\"21\",\"%PH\":\"11\",\"FPHijas\":\"4\",\"STAY\":\"10\",\"Marm\":\"0.48\",\"Rend\":\"0.03\",\"P.Carcasa\":\"21\",\"AOB\":\"0.12\",\"Grasa\":\"0.0\"}]}', '-', '-', null, '-', '262EA247-3041-4BA0-9E46-E38D54AC8A25', 'Jericho W041 x LSF Expectation', '0', '4', 'USA', null);
INSERT INTO `toro` VALUES ('481', '18', 'Mushrush Tritón A330', 'triton', 'TRITÓN', 'Mushrush Red Angus', '-', 'Nueva opción en Angus Colorado para utilizar sobre Vaquillonas. Toro padre proveniente de Mushrush Red Angus, Kansas donde ha sido utilizado masivamente para preñar vaquillonas de pedigree y comerciales de 15 meses con excelentes resultados. Triton es un fiel ejemplo de lo que busca producir esta cabaña; animales sumamente moderados de tamaño y con mucha facilidad de parto pero sin sacrificar características de importancia económica logrando vacas bien productivas, mantenidas y rentables en condiciones totalmente pastoriles. Posee una combinación genética de lujo (Beckton Nebula P707 x Beckton Lancer R107). Su madre, la U214 a quien tuvimos oportunidad de ver, es una de las vacas mas productivas del rodeo. Los hijos del Triton se muestran muy precoces, con mucha calidad racial, color oscuro y bien moderados. Atención a las primeras dosis de este Colorado tan útil para los rodeos Argentinos.', '1', '1', 'Beckton Nebula P P707', 'Mushrush Prairie Madam LN U2', 'Beckton Nebula M045', 'BUF CRK Lancer R017', 'Beckton Lana M809 EP', 'Mushrush Madam WR R270', 'Beckton Neptune R2 K065', 'Beckton Belga K285 JL', 'Beckton Epic K1 K863', 'Beckton Lana K253 DM', 'Beckton Lancer F442 T', 'BUF CRK Juliet N036', 'Beckton Warrior M099 T', 'MUS Prairie Madam 471', 'Red Angus Association (Junio 2017)', '15', 'SI A330', 'En Trámite', 'Semen importado', '0013-04-09', 'En Trámite', '41 cm', '-', '-', '1,35 m', '-', '870 kg', null, '{\"Red Angus Association Importado\":[{\"rowhead\":\"DEP\",\"FPD\":\"13\",\"PN\":\"-3.9\",\"PD\":\"66\",\"P.Año\":\"100\",\"Lecha\":\"23\",\"%PH\":\"14\",\"FPHijas\":\"3\",\"STAY\":\"12\",\"Marm\":\"0.95\",\"Rend\":\"0.29\",\"P.Carcasa\":\"24\",\"AOB\":\"-0.39\",\"Grasa\":\"0.04\"},{\"rowhead\":\"PREC\",\"FPD\":\"38\",\"PN\":\"69\",\"PD\":\"60\",\"P.Año\":\"58\",\"Lecha\":\"30\",\"%PH\":\"33\",\"FPHijas\":\"39\",\"STAY\":\"43\",\"Marm\":\"38\",\"Rend\":\"33\",\"P.Carcasa\":\"47\",\"AOB\":\"33\",\"Grasa\":\"42\"},{\"rowhead\":\"RANKING\",\"FPD\":\"9%\",\"PN\":\"20%\",\"PD\":\"34%\",\"P.Año\":\"35%\",\"Lecha\":\"41%\",\"%PH\":\"20%\",\"FPHijas\":\"55%\",\"STAY\":\"20%\",\"Marm\":\"3%\",\"Rend\":\"99%\",\"P.Carcasa\":\"50%\",\"AOB\":\"98%\",\"Grasa\":\"88%\"},{\"rowhead\":\"PROMEDIO\",\"FPD\":\"5\",\"PN\":\"-1.6\",\"PD\":\"59\",\"P.Año\":\"91\",\"Lecha\":\"21\",\"%PH\":\"11\",\"FPHijas\":\"4\",\"STAY\":\"10\",\"Marm\":\"0.48\",\"Rend\":\"0.03\",\"P.Carcasa\":\"21\",\"AOB\":\"0.12\",\"Grasa\":\"0.0\"}]}', '33', '300', null, '450', '6D1F2C2F-0E36-4206-9FFC-125A4A510661', 'Beckton Nebula P P707 X BUF CRK Lancer R017', '0', '4', 'USA', null);
INSERT INTO `toro` VALUES ('482', '18', 'Mcphee Trophy 36 ', 'trophy', 'TROPHY', 'Mcphee-Bayha', 'ALTA GENETICS, INC. WBD', 'Te presentamos esta nueva incorporación en Angus Colorado, en este caso se trata de un toro importado con tremenda performance. Si estás buscando destetar terneros más pesados, alcanzar los mayores pesos de tus novillos y mejorar el rinde, no hay otro toro en el mercado que pueda hacerlo mejor que TROPHY (92lb para PD y 149lb para P.Año). Ideal también para mejorar la producción de leche de tus vacas (+35) y tener vacas más duraderas. Todo esto sumado a datos bien moderados para peso al nacimiento de sus hijos. Un colorado más que completo que se suma a nuestra batería.', '1', '1', 'Brown Commitment X7787', 'Royce’s Sensational 14', 'Brown Commitment S7206', 'Mcphee New Revelation', 'Brown MS Revelation T7650', 'Jst Ruby’s Robin', 'LJC Lancer 806', 'Brown MS Shazzam P7940', 'Brown Revelation P7021', 'Bola Marsi\' R226', 'Brown Revelation P7021', 'Mcphee Smart Pick 4489', 'Pie Gridmaster 589', 'JST Ruby Red M3234', 'Red Angus Association (Junio 2017)', null, 'SI 36', 'En Trámite', 'Semen importado', '0014-11-02', 'En Trámite', '40 cm', '60 cm', '62 cm', '1,43 m', '1,89 m', '1050 kg', null, '{\"Red Angus Association Importado\":[{\"rowhead\":\"DEP\",\"FPD\":\"5\",\"PN\":\"-1.7\",\"PD\":\"92\",\"P.Año\":\"149\",\"Lecha\":\"35\",\"%PH\":\"12\",\"FPHijas\":\"2\",\"STAY\":\"13\",\"Marm\":\"1.04\",\"Rend\":\"0.1\",\"P.Carcasa\":\"56\",\"AOB\":\"0.42\",\"Grasa\":\"0.02\"},{\"rowhead\":\"PREC\",\"FPD\":\"36\",\"PN\":\"49\",\"PD\":\"41\",\"P.Año\":\"43\",\"Lecha\":\"26\",\"%PH\":\"21\",\"FPHijas\":\"38\",\"STAY\":\"38\",\"Marm\":\"31\",\"Rend\":\"26\",\"P.Carcasa\":\"36\",\"AOB\":\"24\",\"Grasa\":\"35\"},{\"rowhead\":\"RANKING\",\"FPD\":\"50%\",\"PN\":\"50%\",\"PD\":\"2%\",\"P.Año\":\"1%\",\"Lecha\":\"3%\",\"%PH\":\"35%\",\"FPHijas\":\"65%\",\"STAY\":\"15%\",\"Marm\":\"1%\",\"Rend\":\"75%\",\"P.Carcasa\":\"2%\",\"AOB\":\"10%\",\"Grasa\":\"70%\"},{\"rowh