INSERT INTO `toro` VALUES ('483', '18', 'Red U2 Guinness 424DA  ', 'guinness', 'GUINNESS', 'U-2 Ranch', 'ALTA GENETICS, INC. WBD, U-2 Ranch', 'En Marzo de 2017 visitamos la cabaña U2 Angus Ranch. Tuvimos la oportunidad de ver los 150 toros colorados y algunos negros que salían a remate y finalmente decidimos quedarnos con el toro que representa al máximo el programa genético de esta gran cabaña en cuanto a fenotipo y pedigree; sumado a unos EPDs inmejorables para crecimiento; +83Lb para destete y +119Lb al año (Top 1%). Posee un biotipo tremendamente carnicero, mucha estructura, profundidad de costilla y marcado ancho posterior con una línea de lomo y encoladura perfecta, con 42.5 cm de CE en tan solo 13 meses de edad. Nada menos que un hijo del popular RECON 192Y. Les presentamos a RED U2 GUINNESS 424D que se incorpora a la batería de colorados', '1', '1', 'Red U-2 Recon 192y 1629213', 'Red U-2 Bela 443z 1769204', 'Red Brylor West Jet 69w', 'Red Cockburn X-Rated 511x', 'Red U-2 Larkaba 8133u', 'Red U-2 Bela 8200u', 'Red Flying K Ambush 6t', 'Red Flying K Lassie 3t', 'Red U-2 Big League 544r', 'Red U-2 Larkaba 028k', 'Red Cockburn Ribeye 308u', 'Red Cockburn Lasie 180m', 'Red U-2 Big League 544r', 'Red U-2 Bela 934j', 'Canadian Angus Association (Junio 2017)', null, 'SI DUA 424D', 'En Trámite', 'Semen importado', '0018-07-01', 'En Trámite', '40 cm', '53 cm', '58 cm', '1,37 m', '1,65 m', '852 kg', null, '{\"Red Angus Association Importado\":[{\"rowhead\":\"DEP\",\"FPD\":\"-2.1\",\"PN\":\"3.8\",\"PD\":\"83\",\"P.Año\":\"119\",\"Lecha\":\"17\",\"%PH\":\"9\",\"FPHijas\":\"-1.7\",\"STAY\":\"12\",\"Marm\":\"0.2\",\"Rend\":\"0.16\",\"P.Carcasa\":\"46\",\"AOB\":\"-0.11\",\"Grasa\":\"-0.023\"},{\"rowhead\":\"PREC\",\"FPD\":\"17\",\"PN\":\"P+\",\"PD\":\"P+\",\"P.Año\":\"P+\",\"Lecha\":\"P\",\"%PH\":\"P\",\"FPHijas\":\"16\",\"STAY\":\"1\",\"Marm\":\"P\",\"Rend\":\"P\",\"P.Carcasa\":\"P\",\"AOB\":\"P\",\"Grasa\":\"P\"},{\"rowhead\":\"RANKING\",\"FPD\":\"95%\",\"PN\":\"98%\",\"P